, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"582234","type":"CustomJS"},{"attributes":{},"id":"581961","type":"UnionRenderers"},{"attributes":{"coordinates":null,"formatter":{"id":"582200"},"group":null,"major_label_policy":{"id":"582201"},"minor_tick_line_color":null,"ticker":{"id":"582172"}},"id":"582171","type":"LinearAxis"},{"attributes":{"below":[{"id":"582167"}],"center":[{"id":"582170"},{"id":"582174"},{"id":"582208"},{"id":"582210"},{"id":"582229"}],"height":90,"left":[{"id":"582171"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"582195"},{"id":"582215"}],"sizing_mode":"stretch_width","title":{"id":"582197"},"toolbar":{"id":"582183"},"toolbar_location":null,"width":null,"x_range":{"id":"581830"},"x_scale":{"id":"582163"},"y_range":{"id":"582161"},"y_scale":{"id"
